function Display(props){

  return(

      <div className="container">
        <div></div>
        


          {props.data.map((addEmployee)=>(

              <h1>

                  {addEmployee.id} {addEmployee.name} {addEmployee.surname} {addEmployee.position}

              </h1>

          ))}



      </div>

     

  )

}



export default Display;
